import React from 'react';

function Jobs() {
  return (
    <div className="max-w-3xl mx-auto mt-10">
      <h2 className="text-2xl font-semibold mb-4">Available Jobs</h2>
      <ul className="space-y-2">
        <li className="p-4 border rounded shadow hover:bg-gray-100 transition">Software Engineer - Google</li>
        <li className="p-4 border rounded shadow hover:bg-gray-100 transition">Frontend Developer - Microsoft</li>
        <li className="p-4 border rounded shadow hover:bg-gray-100 transition">Backend Developer - Amazon</li>
      </ul>
    </div>
  );
}

export default Jobs;
